webpackJsonp([44099043025034],{3988:function(e,t){e.exports={data:{markdownRemark:{html:'<h2>What is an API</h2>\n<p>API stands for Application Programming Interface. Don’t worry about the AP, just focus on the I. An API is an interface. You use interfaces all the time. A computer operating system is an interface. Buttons in an elevator are an interface. A gas pedal in a car is an interface.</p>\n<p>An interface sits on top of a complicated system and simplifies certain tasks, a middleman that saves you from needing to know all the details of what’s happening under the hood. A web API is the same sort of thing. It sits on top of a web service, like Twitter or YouTube, and simplifies certain tasks for you. It translates your actions into the technical details for the computer system on the other end.</p>\n<p><strong>Here are Top 10 APIs for beginners </strong></p>\n<ol>\n  <li>Dropbox: https://www.dropbox.com/developers</li>\n  <li>Google Maps: https://developers.google.com/maps/web/</li>\n  <li>Twitter: https://dev.twitter.com/docs</li>\n  <li>YouTube: https://developers.google.com/youtube/v3/getting-started</li>\n  <li>Soundcloud: http://developers.soundcloud.com/docs/api/guide#playing</li>\n  <li>Stripe: https://stripe.com/docs/tutorials/checkout</li>\n  <li>Instagram: http://instagram.com/developer/</li>\n  <li>Twilio: https://www.twilio.com/docs</li>\n  <li>Yelp: http://www.yelp.com/developers/getting_started</li>\n  <li>Facebook: https://developers.facebook.com/docs/facebook-login/login-flow-for-web</li>\n</ol>\n<h4>More Information:</h4>\n<ul>\n<li><a href="https://schoolofdata.org/2013/11/18/web-apis-for-non-programmers/">API for non-programmers</a></li>\n<li><a href="https://en.wikipedia.org/wiki/Application_programming_interface">Wikipedia</a></li>\n<li><a href="https://medium.com/girl-geeks/top-10-apis-for-beginners-4d3c43be9386">Medium</a></li>\n</ul>',fields:{slug:"/computer-science/what-is-an-api/"},frontmatter:{title:"What is an API"}}},pathContext:{slug:"/computer-science/what-is-an-api/"}}}});
